const Card = ({ title, imgSrc, imgAlt }) => {
  if (title === "") {
    return (
      <div className="w-40 h-40 flex justify-center items-center flex-col bg-igray-light rounded-2xl p-4">
        <div className="text-xl font-semibold text-center font-pixel text-white">
          Coming soon...
        </div>
      </div>
    );
  }
  return (
    <div className="w-40 h-40 flex justify-center items-center flex-col bg-igray-light rounded-2xl space-y-2 shadow-md p-4">
      <img className="shadow w-20 h-20" src={imgSrc} alt={imgAlt} />
      <div className="text-xl font-semibold font-pixel text-white">{title}</div>
    </div>
  );
};

export default Card;
